import { useState } from "react";

const PRIORITY_COLORS = {
  Critical: "border-red-600",
  High: "border-orange-400",
  Medium: "border-yellow-300",
  Low: "border-green-400",
};

export default function TicketList({ tickets }) {
  const [visibleCount, setVisibleCount] = useState(20);
  const [expandedId, setExpandedId] = useState(null);

  if (!tickets || tickets.length === 0) {
    return <p className="text-center text-gray-500">Nu există tickete disponibile.</p>;
  }

  const toggleExpand = (id) => {
    setExpandedId(expandedId === id ? null : id);
  };

  const loadMore = () => {
    setVisibleCount((prev) => prev + 20);
  };

  return (
    <div>
      {tickets.slice(0, visibleCount).map((ticket) => (
        <div
          key={ticket.id}
          className={`bg-white dark:bg-gray-800 mb-4 p-6 rounded-lg shadow border-l-8 ${
            PRIORITY_COLORS[ticket.priority_name] || "border-gray-400"
          }`}
        >
          <div className="flex justify-between items-start">
            <div>
              <h3 className="text-lg font-semibold text-gray-800 dark:text-gray-200">
                #{ticket.id} - {ticket.incident_title}
              </h3>
              <p className="text-sm text-gray-600 dark:text-gray-400">
                Status: <b>{ticket.status}</b> | Prioritate: <b>{ticket.priority_name}</b> | Start: {ticket.start_date}
              </p>
              <p className="text-sm text-gray-600 dark:text-gray-400">
                Proiect: {ticket.project || "-"} | Echipa: {ticket.team_assigned_person || "-"}
              </p>
            </div>
            <button
              onClick={() => toggleExpand(ticket.id)}
              className="px-3 py-1 rounded-full bg-blue-600 text-white hover:bg-blue-700 text-sm"
            >
              {expandedId === ticket.id ? "Ascunde -" : "Detalii +"}
            </button>
          </div>

          {expandedId === ticket.id && (
            <div className="mt-4 border-t pt-4 text-sm text-gray-700 dark:text-gray-300 grid grid-cols-1 md:grid-cols-2 gap-4">
              <div><b>Descriere:</b> {ticket.description || "-"}</div>
              <div><b>Rezolvare:</b> {ticket.resolution || "-"}</div>
              <div><b>Created By:</b> {ticket.created_by || "-"}</div>
              <div><b>Assigned Person:</b> {ticket.assigned_person || "-"}</div>
              <div><b>Team:</b> {ticket.team_assigned_person || "-"}</div>
              <div><b>Comentariu:</b> {ticket.comment || "-"}</div>
              <div><b>Last Modified:</b> {ticket.last_modified_date || "-"}</div>
              <div><b>Data Închidere:</b> {ticket.closed_date || "-"}</div>
            </div>
          )}
        </div>
      ))}

      {visibleCount < tickets.length && (
        <div className="flex justify-center mt-6">
          <button
            onClick={loadMore}
            className="px-6 py-2 bg-gray-800 text-white rounded-lg hover:bg-gray-700 transition"
          >
            Afișează mai multe
          </button>
        </div>
      )}
    </div>
  );
}
